import './css/carousel.css';

import Navigation from './components/navigation';
import Carousel from './components/carousel';
import Footer from './components/footer';
import Pageindex from './components/indexPage/pageindex';
import Table from './components/table';

import dataServicios from './data/servicios.json';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

//import { Component } from 'react';
function App() {
  return (
    <BrowserRouter>
        <div className="App">
          <header className="App-header">
              <Navigation />
          </header>
          <main>
             <Carousel />

            <div className="container marketing">       
              <Routes>
                <Route path='/' element={<Pageindex />} />
                <Route path='/home' element={<Pageindex />} />
                <Route path='/admin' element={<Table data ={dataServicios.dataervicios} th={['title','description','img','actions']}/>} />
                <Route path='*' element={<div><h1> 404 -Not Found </h1> </div>} />
              </Routes>

              <Footer/>
            </div>
          </main>
       </div>
    </BrowserRouter>
      );
    }
    
    export default App;
